import React from "react";

import "./Alert.css";

const alert = props => {
    let fotoClasses= 'foto-drawer';

    if(props.show) {
        fotoClasses= 'foto-drawer open';
    }
    return(

            <nav className={fotoClasses} >
                <div className="fotogrid">
                    <p>
                        hello success
                    </p>
                </div>
            </ nav>

    );
};

export default alert;
